// src/views/VideoPlayer.js
import React from 'react';
import BodyText from '@enact/sandstone/BodyText';
import Button from '@enact/sandstone/Button';
import css from './VideoPlayer.module.less';

const VideoPlayer = () => {
    const { videoId } = useParams();
    const history = useHistory();

    const handleBack = () => {
        history.goBack();
    };

    return (
        <div className={css.playerContainer}>
            <BodyText className={css.title}>Video Player</BodyText>
            <video controls className={css.video} src={`http://localhost:8080/videos/${videoId}.mp4`} />
            <Button onClick={handleBack} size="small" className={css.button}>
                Back
            </Button>
        </div>
    );
};

export default VideoPlayer;
